"use strict";(self.webpackChunkgovhack_website=self.webpackChunkgovhack_website||[]).push([[418],{930:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"welcome-to-govtech-hackathon","metadata":{"permalink":"/en/blog/welcome-to-govtech-hackathon","editUrl":"https://github.com/YourOrg/govtech-hackathon-site/tree/main/blog/2025-02-22-willkommen-zum-govtech-hackathon.md","source":"@site/i18n/en/docusaurus-plugin-content-blog/2025-02-22-willkommen-zum-govtech-hackathon.md","title":"Welcome to the GovTech Hackathon","description":"We are excited to announce the GovTech Hackathon 2025 in Saarland! From October 11-12, 2025, creative minds, tech enthusiasts, and innovation drivers will come together to develop groundbreaking solutions for the public sector.","date":"2025-02-22T00:00:00.000Z","tags":[{"inline":false,"label":"Hackathon","permalink":"/en/blog/tags/tags/hackathon","description":"Beitr\xe4ge rund um unseren GovTech Hackathon"},{"inline":false,"label":"GovTech","permalink":"/en/blog/tags/tags/govtech","description":"Alles \xfcber technologische Innovation im \xf6ffentlichen Sektor"},{"inline":true,"label":"announcement","permalink":"/en/blog/tags/announcement"}],"readingTime":1.285,"hasTruncateMarker":false,"authors":[{"name":"Daniel Silva F.","title":"Designer f\xfcr systemische Gestaltung","url":"https://www.linkedin.com/in/daniel-silva-f-8a2618237/","page":{"permalink":"/en/blog/authors/daniel"},"socials":{"linkedin":"https://www.linkedin.com/in/daniel-silva-f-8a2618237/"},"imageURL":"https://media.licdn.com/dms/image/v2/D4E03AQGKdH9rgoDS_A/profile-displayphoto-shrink_400_400/profile-displayphoto-shrink_400_400/0/1700746006987?e=1745452800&v=beta&t=2mhTLhQJtmAkZL0xhVLVFAvXuoxLQiva2_w7-_N_5JA","key":"daniel"}],"frontMatter":{"slug":"welcome-to-govtech-hackathon","title":"Welcome to the GovTech Hackathon","authors":["daniel"],"tags":["hackathon","govtech","announcement"]},"unlisted":false},"content":"We are excited to announce the **GovTech Hackathon 2025** in Saarland! From October 11-12, 2025, creative minds, tech enthusiasts, and innovation drivers will come together to develop groundbreaking solutions for the public sector.\\n\\n## What is the GovTech Hackathon?\\n\\nThe GovTech Hackathon is an intensive 48-hour event where interdisciplinary teams work on real challenges from public administration. Our goal: Making the public sector more digital, efficient, and citizen-friendly.\\n\\n## Why should you participate?\\n\\n- **Real Impact**: Your solutions can directly improve citizens\' lives\\n- **Networking**: Meet like-minded people from tech, administration, and business\\n- **Learning Experience**: Learn from experts and expand your skills\\n- **Prizes**: Win attractive prizes and potentially see your solution implemented\\n- **Fun**: Experience the unique hackathon atmosphere\\n\\n## Who are we looking for?\\n\\nEveryone who wants to help shape the digital future of the public sector:\\n- Developers and programmers\\n- Designers and UX experts\\n- Data scientists\\n- Project managers\\n- Public administration employees\\n- Students and interested citizens\\n\\n## Save the Date!\\n\\n\ud83d\udcc5 **When**: October 11-12, 2025\\n\ud83d\udccd **Where**: East Side Fab e.V., Saarbr\xfccken\\n\ud83d\udcb0 **Cost**: Free participation\\n\ud83c\udfaf **Registration**: Starting soon!\\n\\n## What\'s next?\\n\\nIn the coming weeks, we\'ll share more information about:\\n- The specific challenges\\n- Our sponsors and partners\\n- The jury and mentors\\n- Preparatory workshops\\n\\nFollow us on our [social media channels](#) to stay up to date!\\n\\n## Questions?\\n\\nVisit our [FAQ page](/docs/faq) or contact us at [info@govtech-hackathon.saarland](mailto:info@govtech-hackathon.saarland).\\n\\nWe look forward to shaping the future of the public sector with you!\\n\\n**The GovTech Hackathon Team**"}]}}')}}]);